    const error=useRouteError()

    let title='not able to found'
    let message='something went wrong'
    if(error.title)
    title=error.title
if(error.message)
message=error.message
    return <PageContent title='wrong'>
        <p>Someting Went Wrong!!</p>
    </PageContent>
}

export default ErrorPage
